import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'HanXia1',
          id: '1'
        },
        {
          name: 'HanXia2',
          id: '2'
        },
        {
          name: 'HanXia3',
          id: '3'
        }
      ]
    };
  }

  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map(monsters => (
            <h1> { monsters.name } </h1> 
          ))}
      </div>
    );
  }
}

export default App;
